import React from 'react';
import './style.css';
import { helper } from '../helpers/common';
const GlobalCorona = (data, error) => {
	if (!helper.getPropsId(error) || helper.getPropsId(data)) {
		console.log(error);
	}
	console.log(data.data.Global);
	return (
		<section className="global__corona">
			<div className="global__item">
				<p>-Moi nhiem: {data.data.Global.NewConfirmed}</p>
				<p>-Tong ca nhiem: {data.data.Global.TotalConfirmed} </p>
			</div>
			<div className="global__item">
				<p>-Moi tu vong: {data.data.Global.NewDeaths} </p>
				<p>-Tong ca tu vong: {data.data.Global.TotalDeaths} </p>
			</div>
			<div className="global__item">
				<p>-Moi khoi benh: {data.data.Global.NewRecovered} </p>
				<p>-Tong ca khoi benh: {data.data.Global.TotalRecovered} </p>
			</div>
		</section>
	);
};
export default GlobalCorona;
